const BlogInfo = ({blog}) => {
    return(
        <div>
            <em>rl: {blog.url}</em><br/>
            <em>likes: {blog.likes}</em><br/>
            <em>author: {blog.author}</em><br/>
        </div>
    )
}
export default BlogInfo
